バッグ型スマートキーケース(全６色）<br><br>

インナーチェーンがついているのでスマートキーが落ちる心配無し☆<br><br>

スマートキーはもちろん、小物入れとしても使えます♪
（サイズをご確認下さい。）<br>
キーリング付きなので、カギやお好きなチャームをつけることも可能！<br><br>

カバンのチャームとしてもお使いいただけます♪<br><br>

とっても可愛く、パッケージにも入っているので、プレゼントにも最適です♪ <br><br>

【カラー】ブラック/レッド/ピンク/オレンジ/ブルー/パープル<br><br>
【サイズ】収納内径：約縦70mm×横50mm×マチ25mm <br>※サイズを必ずご確認下さい。
<br><br>
【素材】PUレザー<br><br><br>







